import React from 'react';
import Background from './components/Background';
import OceanSunfish from './components/OceanSunfish';
import ContributionCalendar from './components/ContributionCalendar';
import UIBox from './components/UIBox';
import './App.css';

function App() {
  return (
      <div className="App">
        <Background />
        <OceanSunfish />
        <div className="ui-container">
          <UIBox className="level-box" title="개복치 레벨" content="시간/날짜" />
          <UIBox className="algo-box" title="알고리즘" content="웹사이트 이동" />
          <ContributionCalendar />
          <UIBox className="contribution-box" title="기여도" />
          <UIBox className="todo-box" title="Todo-List" />
        </div>
      </div>
  );
}

export default App;
